import React from 'react'

export function Tarjetacuenta({cuentadatos}) {
    let pepe=1233;
    if(pepe=123){
        return (
            <>
            <h4>{cuentadatos._id}</h4>
            <p>{cuentadatos.servidor}€</p>
            <h1>OK</h1>
            </>
          )
    }else{
        return (
            <>
            <h4>{cuentadatos._id}</h4>
            <p>{cuentadatos.servidor}€</p>
            <h1>WTF</h1>
            </>
          )
    }
  
}
